INSERT INTO `algorithm_algorithm` VALUES (1,'Fifo\n','FIFO is an acronym for First In, First Out, which is an abstraction related to ways of organizing and manipulation of data relative to time and prioritization. This expression describes the principle of a queue processing technique or servicing conflicting demands by ordering process by first-come, first-served (FCFS) behaviour: where the persons leave the queue in the order they arrive, or waiting one\'s turn at a traffic control signal.',5,'http://dbpedia.org/resource/FIFO',1,0.175,NULL,'2014-11-04'),(2,'Cycle Detection\n','In computer science, cycle detection is the algorithmic problem of finding a cycle in a sequence of iterated function values.',14,'http://dbpedia.org/resource/Cycle_detection',1,0.416666666666667,NULL,'2014-11-04'),(3,'Multiply With Carry\n','In computer science, multiply-with-carry (MWC) is a method invented by George Marsaglia for generating sequences of random integers based on an initial set from two to many thousands of randomly chosen seed values. The main advantages of the MWC method are that it invokes simple computer integer arithmetic and leads to very fast generation of sequences of random numbers with immense periods, ranging from around 260 to 22000000.',18,'http://dbpedia.org/resource/Multiply-with-carry',1,NULL,NULL,'2014-11-04'),(4,'Random Password Generator\n','A random password generator is software program or hardware device that takes input from a random or pseudo-random number generator and automatically generates a password. Random passwords can be generated manually, using simple sources of randomness such as dice or coins, or they can be generated using a computer.',16,'http://dbpedia.org/resource/Random_password_generator',1,0.229166666666667,NULL,'2014-11-04'),(5,'Left Recursion\n','In the formal language theory of computer science, left recursion is a special case of recursion.',2,'http://dbpedia.org/resource/Left_recursion',1,NULL,NULL,'2014-11-04'),(6,'Longitudinal Redundancy Check\n','In telecommunication, a longitudinal redundancy check (LRC) or horizontal redundancy check is a form of redundancy check that is applied independently to each of a parallel group of bit streams. The data must be divided into transmission blocks, to which the additional check data is added.',4,'http://dbpedia.org/resource/Longitudinal_redundancy_check',1,NULL,NULL,'2014-11-04'),(7,'Fast Inverse Square Root\n','Fast inverse square root (sometimes referred to as Fast InvSqrt() or by the hexadecimal constant 0x5f3759df) is a method of calculating x−½, the reciprocal (or multiplicative inverse) of a square root for a 32-bit floating point number in IEEE 754 floating point format. The algorithm was probably developed at Silicon Graphics in the early 1990s, and an implementation appeared in 1999 in the Quake III Arena source code, but the method did not appear on public forums such as Usenet until 2002 or 2003.[1] At the time, the primary advantage of the algorithm came from avoiding computationally expensive floating point operations in favor of integer operations. Inverse square roots are used to compute angles of incidence and reflection for lighting and shading in computer graphics.',8,'http://dbpedia.org/resource/Fast_inverse_square_root',1,NULL,NULL,'2014-11-04'),(8,'Luhn Algorithm\n','The Luhn algorithm or Luhn formula, also known as the \"modulus 10\" or \"mod 10\" algorithm, is a simple checksum formula used to validate a variety of identification numbers, such as credit card numbers, IMEI numbers, National Provider Identifier numbers in US and Canadian Social Insurance Numbers. It was created by IBM scientist Hans Peter Luhn and described in U.S. Patent No. 2,950,048, filed on January 6, 1954, and granted on August 23, 1960.',4,'http://dbpedia.org/resource/Luhn_algorithm',1,NULL,NULL,'2014-11-04'),(9,'Recursion (computer Science)\n','Recursion in computer science is a method where the solution to a problem depends on solutions to smaller instances of the same problem (as opposed to iteration).[1] The approach can be applied to many types of problems, and recursion is one of the central ideas of computer science.[2]',2,'http://dbpedia.org/resource/Recursion_(computer_science)',1,NULL,NULL,'2014-11-04'),(10,'Minimax\n','Minimax (sometimes minmax) is a decision rule used in decision theory, game theory, statistics and philosophy for minimizing the possible loss for a worst case (maximum loss) scenario. Alternatively, it can be thought of as maximizing the minimum gain (maximin). Originally formulated for two-player zero-sum game theory, covering both the cases where players take alternate moves and those where they make simultaneous moves, it has also been extended to more complex games and to general decision making in the presence of uncertainty.',13,'http://dbpedia.org/resource/Minimax',1,NULL,NULL,'2014-11-04'),(11,'Counting Sort\n','In computer science, counting sort is an algorithm for sorting a collection of objects according to keys that are small integers; that is, it is an integer sorting algorithm. It operates by counting the number of objects that have each distinct key value, and using arithmetic on those counts to determine the positions of each key value in the output sequence. Its running time is linear in the number of items and the difference between the maximum and minimum key values, so it is only suitable for direct use in situations where the variation in keys is not significantly greater than the number of items. However, it is often used as a subroutine in another sorting algorithm, radix sort, that can handle larger keys more efficiently.[1][2][3]',7,'http://dbpedia.org/resource/Counting_sort',1,0.283333333333333,NULL,'2014-11-04'),(12,'Gradient Descent\n','Gradient descent is a first-order optimization algorithm. To find a local minimum of a function using gradient descent, one takes steps proportional to the negative of the gradient (or of the approximate gradient) of the function at the current point. If instead one takes steps proportional to the positive of the gradient, one approaches a local maximum of that function; the procedure is then known as gradient ascent.',13,'http://dbpedia.org/resource/Gradient_descent',1,NULL,NULL,'2014-11-04'),(13,'Insertion Sort\n','Insertion sort is a simple sorting algorithm that builds the final sorted array (or list) one item at a time. It is much less efficient on large lists than more advanced algorithms such as quicksort, heapsort, or merge sort. However, insertion sort provides several advantages:',7,'http://dbpedia.org/resource/Insertion_sort',1,0.458333333333333,NULL,'2014-11-04'),(14,'Merge Sort\n','O(n log n) typical,',7,'http://dbpedia.org/resource/Merge_sort',1,0.85,NULL,'2014-11-04'),(15,'Quicksort\n','Quicksort, or paralgpediaalgpediatition-exchange sort, is a sorting algorithm developed by Tony Hoare that, on average, makes O(n log n) comparisons to sort n items. In the worst case, it makes O(n2) comparisons, though this behavior is rare. Quicksort is often faster in practice than other O(n log n) algorithms.[1] Additionally, quicksort\'s sequential and localized memory references work well with a cache. Quicksort is a comparison sort and, in efficient implementations, is not a stable sort. Quicksort can be implemented with an in-place partitioning algorithm, so the entire sort can be done with only O(log n) additional space used by the stack during the recursion.[2]',7,'http://dbpedia.org/resource/Quicksort',1,0.740058479532164,NULL,'2014-11-04'),(16,'Radix Sort\n','In computer science, radix sort is a non-comparative integer sorting algorithm that sorts data with integer keys by grouping keys by the individual digits which share the same significant position and value. A positional notation is required, but because integers can represent strings of characters (e.g., names or dates) and specially formatted floating point numbers, radix sort is not limited to integers. Radix sort dates back as far as 1887 to the work of Herman Hollerith on tabulating machines.[1]',7,'http://dbpedia.org/resource/Radix_sort',1,NULL,NULL,'2014-11-04'),(17,'Recursion\n','Recursion is the process of repeating items in a self-similar way. For instance, when the surfaces of two mirrors are exactly parallel with each other the nested images that occur are a form of infinite recursion. The term has a variety of meanings specific to a variety of disciplines ranging from linguistics to logic. The most common application of recursion is in mathematics and computer science, in which it refers to a method of defining functions in which the function being defined is applied within its own definition. Specifically this defines an infinite number of instances (function values), using a finite expression that for some instances may refer to other instances, but in such a way that no loop or infinite chain of references can occur. The term is also used more generally to describe a process of repeating objects in a self-similar way.',2,'http://dbpedia.org/resource/Recursion',1,NULL,NULL,'2014-11-04'),(18,'Selection Sort\n','In computer science, selection sort is a sorting algorithm, specifically an in-place comparison sort. It has O(n2) time complexity, making it inefficient on large lists, and generally performs worse than the similar insertion sort. Selection sort is noted for its simplicity, and it has performance advantages over more complicated algorithms in certain situations, particularly where auxiliary memory is limited.',7,'http://dbpedia.org/resource/Selection_sort',1,NULL,NULL,'2014-11-04'),(19,'Mutual Recursion\n','In mathematics and computer science, mutual recursion is a form of recursion where two mathematical or computational objects, such as functions or data types, are defined in terms of each other.[1] Mutual recursion is very common in functional programming and in some problem domains, such as recursive descent parsers, where the data types are naturally mutually recursive, but is uncommon in other domains.',2,'http://dbpedia.org/resource/Mutual_recursion',1,NULL,NULL,'2014-11-04'),(20,'Shellsort\n','Shellsort, also known as Shell sort or Shell\'s method, is an in-place comparison sort. It generalizes an exchanging sort, such as insertion or bubble sort, by starting the comparison and exchange of elements with elements that are far apart before finishing with neighboring elements. Starting with far apart elements can move some out-of-place elements into position faster than a simple nearest neighbor exchange. Donald Shell published the first version of this sort in 1959.[1][2] The running time of Shellsort is heavily dependent on the gap sequence it uses. For many practical variants, determining their time complexity remains an open problem.',7,'http://dbpedia.org/resource/Shellsort',1,NULL,NULL,'2014-11-04'),(21,'Polymorphic Recursion\n','In computer science, polymorphic recursion (also referred to as Milner–Mycroft typability or the Milner–Mycroft calculus) refers to a recursive parametrically polymorph function where the type parameter changes with each recursive invocation made instead of staying constant. Type inference for polymorphic recursion is equivalent to semi-unification and thefore undecidable and requires the use of a semi-algorithm or programmer supplied type annotations.[1]',2,'http://dbpedia.org/resource/Polymorphic_recursion',1,NULL,NULL,'2014-11-04'),(22,'Newton\'s Method\n','In numerical analysis, Newton\'s method (also known as the Newton–Raphson method), named after Isaac Newton and Joseph Raphson, is a method for finding successively better approximations to the roots (or zeroes) of a real-valued function.',13,'http://dbpedia.org/resource/Newton\'s_method',1,NULL,NULL,'2014-11-04'),(23,'Newton\'s Method\n','In numerical analysis, Newton\'s method (also known as the Newton–Raphson method), named after Isaac Newton and Joseph Raphson, is a method for finding successively better approximations to the roots (or zeroes) of a real-valued function.',8,'http://dbpedia.org/resource/Newton\'s_method',1,NULL,NULL,'2014-11-04'),(24,'Fold (higher Order Function)\n','In functional programming, fold – also known variously as reduce, accumulate, aggregate, compress, or inject – refers to a family of higher-order functions that analyze a recursive data structure and recombine through use of a given combining operation the results of recursively processing its constituent parts, building up a return value. Typically, a fold is presented with a combining function, a top node of a data structure, and possibly some default values to be used under certain conditions. The fold then proceeds to combine elements of the data structure\'s hierarchy, using the function in a systematic way.',2,'http://dbpedia.org/resource/Fold_(higher-order_function)',1,NULL,NULL,'2014-11-04'),(25,'Golden Section Search\n','The golden section search is a technique for finding the extremum (minimum or maximum) of a strictly unimodal function by successively narrowing the range of values inside which the extremum is known to exist. The technique derives its name from the fact that the algorithm maintains the function values for triples of points whose distances form a golden ratio. The algorithm is the limit of Fibonacci search (also described below) for a large number of function evaluations. Fibonacci search and Golden section search were discovered by Kiefer (1953). (see also Avriel and Wilde (1966)).',13,'http://dbpedia.org/resource/Golden_section_search',1,NULL,NULL,'2014-11-04'),(26,'Linear Feedback Shift Register','In computing, a linear feedback shift register (LFSR) is a shift register whose input bit is a linear function of its previous state.',16,'http://dbpedia.org/resource/Linear_feedback_shift_register',1,NULL,NULL,'2014-11-04'),(27,'Linear Feedback Shift Register','In computing, a linear feedback shift register (LFSR) is a shift register whose input bit is a linear function of its previous state.',18,'http://dbpedia.org/resource/Linear_feedback_shift_register',1,NULL,NULL,'2014-11-04'),(28,'Brent\'s Method\n','In numerical analysis, Brent\'s method is a complicated but popular root-finding algorithm combining the bisection method, the secant method and inverse quadratic interpolation. It has the reliability of bisection but it can be as quick as some of the less reliable methods. The idea is to use the secant method or inverse quadratic interpolation if possible, because they converge faster, but to fall back to the more robust bisection method if necessary. Brent\'s method is due to Richard Brent (1973) and builds on an earlier algorithm of Theodorus Dekker (1969).',8,'http://dbpedia.org/resource/Brent\'s_method',1,NULL,NULL,'2014-11-04'),(29,'Odd–even Sort\n','In computing, an odd–even sort or odd–even transposition sort (also known as brick sort[1]) is a relatively simple sorting algorithm, developed originally for use on parallel processors with local interconnections. It is a comparison sort related to bubble sort, with which it shares many characteristics. It functions by comparing all (odd, even)-indexed pairs of adjacent elements in the list and, if a pair is in the wrong order (the first is larger than the second) the elements are switched. The next step repeats this for (even, odd)-indexed pairs (of adjacent elements). Then it alternates between (odd, even) and (even, odd) steps until the list is sorted.',7,'http://dbpedia.org/resource/Odd%E2%80%93even_sort',1,NULL,NULL,'2014-11-04'),(30,'Tail Call\n','In computer science, a tail call is a subroutine call that happens inside another procedure as its final action; it may produce a return value which is then immediately returned by the calling procedure. The call site is then said to be in tail position, i.e. at the end of the calling procedure. If any call that a subroutine performs, such that it might eventually lead to this same subroutine being called again down the call chain, is in tail position, such a subroutine is said to be tail-recursive, which is a special case of recursion. Tail calls need not be recursive – the call can be to another function – but tail recursion is particularly useful, and often easier to handle in implementations.',2,'http://dbpedia.org/resource/Tail_call',1,NULL,NULL,'2014-11-04'),(31,'Proxmap Sort\n','ProxmapSort, or Proxmap sort, is a sorting algorithm that works by partitioning an array of data items, or keys, into a number of \"subarrays\" (termed buckets, in similar sorts). The name is short for computing a \"proximity map,\" which indicates for each key K the beginning of a subarray where K will reside in the final sorted order. Keys are placed into each subarray using insertion sort. If keys are \"well distributed\" among the subarrays, sorting occurs in linear time, much faster than comparison-based sorting, which can do no better than . The computational complexity estimates involve the number of subarrays and the proximity mapping function, the \"map key,\" used. It is a form of bucket and radix sort. The algorithm scales up well as the number of data become large.',7,'http://dbpedia.org/resource/Proxmap_sort',1,NULL,NULL,'2014-11-04'),(32,'Maximum Subarray Problem\n','In computer science, the maximum subarray problem is the task of finding the contiguous subarray within a one-dimensional array of numbers (containing at least one positive number) which has the largest sum. For example, for the sequence of values −2, 1, −3, 4, −1, 2, 1, −5, 4; the contiguous subarray with the largest sum is 4, −1, 2, 1, with sum 6.',13,'http://dbpedia.org/resource/Maximum_subarray_problem',1,NULL,NULL,'2014-11-04'),(33,'Discrete Wavelet Transform\n','In numerical analysis and functional analysis, a discrete wavelet transform (DWT) is any wavelet transform for which the wavelets are discretely sampled. As with other wavelet transforms, a key advantage it has over Fourier transforms is temporal resolution: it captures both frequency and location information (location in time).',1,'http://dbpedia.org/resource/Discrete_wavelet_transform',1,NULL,NULL,'2014-11-04'),(34,'Hamming(7,4)\n','In coding theory, Hamming(7,4) is a linear error-correcting code that encodes 4 bits of data into 7 bits by adding 3 parity bits. It is a member of a larger family of Hamming codes, but the term Hamming code often refers to this specific code that Richard W. Hamming introduced in 1950. At the time, Hamming worked at Bell Telephone Laboratories and was frustrated with the error-prone punched card reader, which is why he started working on error-correcting codes.[1]',4,'http://dbpedia.org/resource/Hamming(7,4)',1,NULL,NULL,'2014-11-04'),(35,'Steffensen\'s Method\n','In numerical analysis, Steffensen\'s method is a root-finding method, similar to Newton\'s method, named after Johan Frederik Steffensen. Steffensen\'s method also achieves quadratic convergence, but without using derivatives as Newton\'s method does.',8,'http://dbpedia.org/resource/Steffensen\'s_method',1,NULL,NULL,'2014-11-04'),(36,'Multivariate Kernel Density Es','Kernel density estimation is a nonparametric technique for density estimation i.e., estimation of probability density functions, which is one of the fundamental questions in statistics. It can be viewed as a generalisation of histogram density estimation with improved statistical properties. Apart from histograms, other types of density estimators include parametric, spline, wavelet and Fourier series. Kernel density estimators were first introduced in the scientific literature for univariate data in the 1950s and 1960s[1][2] and subsequently have been widely adopted. It was soon recognised that analogous estimators for multivariate data would be an important addition to multivariate statistics. Based on research carried out in the 1990s and 2000s, multivariate kernel density estimation has reached a level of maturity comparable to their univariate counterparts.[3]',21,'http://dbpedia.org/resource/Multivariate_kernel_density_estimation',1,NULL,NULL,'2014-11-04'),(37,'Viterbi Algorithm\n','The Viterbi algorithm is a dynamic programming algorithm for finding the most likely sequence of hidden states – called the Viterbi path – that results in a sequence of observed events, especially in the context of Markov information sources and hidden Markov models.',4,'http://dbpedia.org/resource/Viterbi_algorithm',1,NULL,NULL,'2014-11-04'),(38,'Corecursion\n','In computer science, corecursion is a type of operation that is dual to recursion. Whereas recursion works analytically, starting on data further from a base case and breaking it down into smaller data and repeating until one reaches a base case, corecursion works synthetically, starting from a base case and building it up, iteratively producing data further removed from a base case. Put simply, corecursive algorithms use the data that they themselves produce, bit by bit, as they become available, and needed, to produce further bits of data. Some authors refer to this as generative recursion.',2,'http://dbpedia.org/resource/Corecursion',1,NULL,NULL,'2014-11-04'),(39,'Secant Method\n','In numerical analysis, the secant method is a root-finding algorithm that uses a succession of roots of secant lines to better approximate a root of a function f. The secant method can be thought of as a finite difference approximation of Newton\'s method. However, the method was developed independently of Newton\'s method, and predated the latter by over 3,000 years.[1]',8,'http://dbpedia.org/resource/Secant_method',1,NULL,NULL,'2014-11-04'),(40,'Backpropagation\n','Backpropagation, an abbreviation for \"backward propagation of errors\", is a common method of training artificial neural networks. From a desired output, the network learns from many inputs, similar to the way a child learns to identify a dog from examples of dogs.',12,'http://dbpedia.org/resource/Backpropagation',1,NULL,NULL,'2014-11-04'),(41,'Comb Sort\n','Comb sort is a relatively simple sorting algorithm originally designed by Włodzimierz Dobosiewicz in 1980.[1] Later it was rediscovered by Stephen Lacey and Richard Box in 1991.[2] Comb sort improves on bubble sort.',7,'http://dbpedia.org/resource/Comb_sort',1,NULL,NULL,'2014-11-04'),(42,'Gnome Sort\n','Gnome sort (Stupid sort), originally proposed by Hamid Sarbazi-Azad in 2000 and called Stupid sort (not to be confused with Bogosort), and then later on described by Dick Grune and named \"Gnome sort\",[1] is a sorting algorithm which is similar to insertion sort, except that moving an element to its proper place is accomplished by a series of swaps, as in bubble sort. It is conceptually simple, requiring no nested loops. The running time is O, but tends towards O(n) if the list is initially almost sorted.[2] In practice the algorithm can run as fast as Insertion sort[citation needed]. The average runtime is .',7,'http://dbpedia.org/resource/Gnome_sort',1,NULL,NULL,'2014-11-04'),(43,'Fisher–yates Shuffle\n','The Fisher–Yates shuffle (named after Ronald Fisher and Frank Yates), also known as the Knuth shuffle (after Donald Knuth), is an algorithm for generating a random permutation of a finite set—in plain terms, for randomly shuffling the set. A variant of the Fisher–Yates shuffle, known as Sattolo\'s algorithm, may be used to generate random cycles of length n instead. Properly implemented, the Fisher–Yates shuffle is unbiased, so that every permutation is equally likely. The modern version of the algorithm is also rather efficient, requiring only time proportional to the number of items being shuffled and no additional storage space.',14,'http://dbpedia.org/resource/Fisher%E2%80%93Yates_shuffle',1,NULL,NULL,'2014-11-04'),(44,'Infinite Loop\n','An infinite loop (also known as an endless loop or unproductive loop) is a sequence of instructions in a computer program which loops endlessly, either due to the loop having no terminating condition, having one that can never be met, or one that causes the loop to start over. In older operating systems with cooperative multitasking, infinite loops normally caused the entire system to become unresponsive. With the now-prevalent preemptive multitasking model, infinite loops usually cause the program to consume all available processor time, but can usually be terminated by the user. Busy-wait loops are also sometimes called \"infinite loops\". One possible cause of a computer \"freezing\" is an infinite loop; others include deadlock and access violations.',2,'http://dbpedia.org/resource/Infinite_loop',1,NULL,NULL,'2014-11-04'),(45,'Shrinking Generator\n','In cryptography, the shrinking generator is a form of pseudorandom number generator intended to be used in a stream cipher. It was published in Crypto 1993 by Don Coppersmith, Hugo Krawczyk, and Yishay Mansour.',18,'http://dbpedia.org/resource/Shrinking_generator',1,NULL,NULL,'2014-11-04'),(46,'Marsaglia Polar Method\n','The polar method (attributed to George Marsaglia, 1964[1]) is a pseudo-random number sampling method for generating a pair of independent standard normal random variables. While it is superior to the Box–Muller transform[citation needed], the Ziggurat algorithm is even more efficient.[2]',18,'http://dbpedia.org/resource/Marsaglia_polar_method',1,NULL,NULL,'2014-11-04'),(47,'Cycle Sort\n','Cycle sort is an in-place, unstable sorting algorithm, a comparison sort that is theoretically optimal in terms of the total number of writes to the original array, unlike any other in-place sorting algorithm. It is based on the idea that the permutation to be sorted can be factored into cycles, which can individually be rotated to give a sorted result.',7,'http://dbpedia.org/resource/Cycle_sort',1,0.833333333333333,NULL,'2014-11-04'),(48,'American Flag Sort\n','An american flag sort is an efficient, in-place variant of radix sort that distributes items into hundreds of buckets. Non-comparative sorting algorithms such as radix sort and american flag sort are typically used to sort large objects such as strings, for which comparison is not a unit-time operation.[1] American flag sort iterates through the bits of the objects, considering several bits of each object at a time. For each set of bits, american flag sort makes two passes through the array of objects: first to count the number of objects that will fall in each bin, and second to place each object in its bucket. This works especially well when sorting a byte at a time, using 256 buckets. With some optimizations, it is twice as fast as quicksort for large sets of strings.[1]',7,'http://dbpedia.org/resource/American_flag_sort',1,1,NULL,'2014-11-04'),(49,'Bitonic Sorter\n','Bitonic mergesort is a parallel algorithm for sorting. It is also used as a construction method for building a sorting network. The algorithm was devised by Ken Batcher. The resulting sorting networks consist of  comparators and have a delay of , where  is the number of items to be sorted.[1]',7,'http://dbpedia.org/resource/Bitonic_sorter',1,NULL,NULL,'2014-11-04'),(50,'Cma Es\n','CMA-ES stands for Covariance Matrix Adaptation Evolution Strategy. Evolution strategies (ES) are stochastic, derivative-free methods for numerical optimization of non-linear or non-convex continuous optimization problems. They belong to the class of evolutionary algorithms and evolutionary computation. An evolutionary algorithm is broadly based on the principle of biological evolution, namely the repeated interplay of variation (via mutation and recombination) and selection: in each generation (iteration) new individuals (candidate solutions, denoted as ) are generated by variation, usually in a stochastic way, and then some individuals are selected for the next generation based on their fitness or objective function value . Like this, over the generation sequence, individuals with better and better -values are generated.',26,'http://dbpedia.org/resource/CMA-ES',1,NULL,NULL,'2014-11-04'),(51,'Cma Es\n','CMA-ES stands for Covariance Matrix Adaptation Evolution Strategy. Evolution strategies (ES) are stochastic, derivative-free methods for numerical optimization of non-linear or non-convex continuous optimization problems. They belong to the class of evolutionary algorithms and evolutionary computation. An evolutionary algorithm is broadly based on the principle of biological evolution, namely the repeated interplay of variation (via mutation and recombination) and selection: in each generation (iteration) new individuals (candidate solutions, denoted as ) are generated by variation, usually in a stochastic way, and then some individuals are selected for the next generation based on their fitness or objective function value . Like this, over the generation sequence, individuals with better and better -values are generated.',13,'http://dbpedia.org/resource/CMA-ES',1,NULL,NULL,'2014-11-04'),(52,'Dutch National Flag Problem\n','The Dutch national flag problem is a famous computer science related programming problem proposed by Edsger Dijkstra. The flag of the Netherlands consists of three colours: red, white and blue. Given balls of these three colours arranged randomly in a line (the actual number of balls does not matter), the task is to arrange them such that all balls of the same colour are together and their collective colour groups are in the correct order.',7,'http://dbpedia.org/resource/Dutch_national_flag_problem',1,NULL,NULL,'2014-11-04'),(53,'Library Sort\n','Library sort, or gapped insertion sort is a sorting algorithm that uses an insertion sort, but with gaps in the array to accelerate subsequent insertions. The name comes from an analogy:[1]',7,'http://dbpedia.org/resource/Library_sort',1,NULL,NULL,'2014-11-04'),(54,'Schwartzian Transform\n','In computer science, the Schwartzian transform is a Perl programming idiom used to improve the efficiency of sorting a list of items. This idiom is appropriate for comparison-based sorting when the ordering is actually based on the ordering of a certain property (the key) of the elements, where computing that property is an intensive operation that should be performed a minimal number of times. The Schwartzian Transform is notable in that it does not use named temporary arrays.',7,'http://dbpedia.org/resource/Schwartzian_transform',1,NULL,NULL,'2014-11-04'),(55,'Spreadsort\n','Spreadsort is a sorting algorithm invented by Steven J. Ross in 2002.[1] It combines concepts from distribution-based sorts, such as radix sort and bucket sort, with partitioning concepts from comparison sorts such as quicksort and mergesort. In experimental results it was shown to be highly efficient, often outperforming traditional algorithms such as quicksort, particularly on distributions exhibiting structure.',7,'http://dbpedia.org/resource/Spreadsort',1,NULL,NULL,'2014-11-04'),(56,'Stooge Sort\n','Stooge sort is a recursive sorting algorithm with a time complexity of O(nlog 3 / log 1.5 ) = O(n2.7095...). The running time of the algorithm is thus extremely slow compared to efficient sorting algorithms, such as Merge sort, and is even slower than Bubble sort, a canonical example of a fairly inefficient and simple sort.',7,'http://dbpedia.org/resource/Stooge_sort',1,NULL,NULL,'2014-11-04'),(57,'Strand Sort\n','Strand sort is a sorting algorithm. It works by repeatedly pulling sorted sublists out of the list to be sorted and merging them with a result array. Each iteration through the unsorted list pulls out a series of elements which were already sorted, and merges those series together.',7,'http://dbpedia.org/resource/Strand_sort',1,NULL,NULL,'2014-11-04'),(58,'Tree Sort\n','O(n2) (unbalanced)',7,'http://dbpedia.org/resource/Tree_sort',1,NULL,NULL,'2014-11-04'),(59,'Middle Square Method\n','In mathematics, the middle-square method is a method of generating pseudorandom numbers. In practice it is not a good method, since its period is usually very short and it has some crippling weaknesses, such as the output sequence always converging to zero.',18,'http://dbpedia.org/resource/Middle-square_method',1,NULL,NULL,'2014-11-04'),(60,'Batcher Odd–even Mergesort\n','Batcher\'s odd–even mergesort is a generic construction devised by Ken Batcher for sorting networks of size O(n (log n)2) and depth O((log n)2), where n is the number of items to be sorted. Although it is not asymptotically optimal, Knuth concluded in 1998, with respect to the AKS network that \"Batcher\'s method is much better, unless n exceeds the total memory capacity of all computers on earth!\"[1]',7,'http://dbpedia.org/resource/Batcher_odd%E2%80%93even_mergesort',1,0.916666666666667,NULL,'2014-11-04'),(61,'Berlekamp–massey Algorithm\n','The Berlekamp–Massey algorithm is an algorithm that will find the shortest linear feedback shift register (LFSR) for a given binary output sequence. The algorithm will also find the minimal polynomial of a linearly recurrent sequence in an arbitrary field.[1]',4,'http://dbpedia.org/resource/Berlekamp%E2%80%93Massey_algorithm',1,NULL,NULL,'2014-11-04'),(62,'Randomized Algorithm\n','Random binary tree · Treap',23,'http://dbpedia.org/resource/Randomized_algorithm',1,NULL,NULL,'2014-11-04'),(63,'Randomized Algorithm\n','Random binary tree · Treap',25,'http://dbpedia.org/resource/Randomized_algorithm',1,NULL,NULL,'2014-11-04'),(64,'Xorshift\n','Xorshift random number generators form a class of pseudorandom number generators that was discovered by George Marsaglia.[1] They generate the next number in their sequence by repeatedly taking the exclusive or of a number with a bit shifted version of itself. This makes them extremely fast on modern computer architectures. The xor shift primitive is invertible.[2]They are a subclass of linear feedback shift registers, but their simple implementation typically makes them faster and use less space.[3] However, the parameters have to be chosen very carefully in order to achieve a long period.[4]',18,'http://dbpedia.org/resource/Xorshift',1,NULL,NULL,'2014-11-04'),(65,'Forward–backward Algorithm\n','The forward–backward algorithm is an inference algorithm for hidden Markov models which computes the posterior marginals of all hidden state variables given a sequence of observations/emissions , i.e. it computes, for all hidden state variables , the distribution . This inference task is usually called smoothing. The algorithm makes use of the principle of dynamic programming to efficiently compute the values that are required to obtain the posterior marginal distributions in two passes. The first pass goes forward in time while the second goes backward in time; hence the name forward–backward algorithm.',4,'http://dbpedia.org/resource/Forward%E2%80%93backward_algorithm',1,NULL,NULL,'2014-11-04'),(66,'Forward–backward Algorithm\n','The forward–backward algorithm is an inference algorithm for hidden Markov models which computes the posterior marginals of all hidden state variables given a sequence of observations/emissions , i.e. it computes, for all hidden state variables , the distribution . This inference task is usually called smoothing. The algorithm makes use of the principle of dynamic programming to efficiently compute the values that are required to obtain the posterior marginal distributions in two passes. The first pass goes forward in time while the second goes backward in time; hence the name forward–backward algorithm.',12,'http://dbpedia.org/resource/Forward%E2%80%93backward_algorithm',1,NULL,NULL,'2014-11-04'),(67,'Z Order Curve\n','In mathematical analysis and computer science, Z-order, Morton order, or Morton code is a function which maps multidimensional data to one dimension while preserving locality of the data points. It was introduced in 1966 by G. M. Morton.[1] The z-value of a point in multidimensions is simply calculated by interleaving the binary representations of its coordinate values. Once the data are sorted into this ordering, any one-dimensional data structure can be used such as binary search trees, B-trees, skip lists or (with low significant bits truncated) hash tables. The resulting ordering can equivalently be described as the order one would get from a depth-first traversal of a quadtree; because of its close connection with quadtrees, the Z-ordering can be used to efficiently construct quadtrees and related higher dimensional data structures.[2]',19,'http://dbpedia.org/resource/Z-order_curve',1,NULL,NULL,'2014-11-04'),(68,'Convolutional Code\n','In telecommunication, a convolutional code is a type of error-correcting code in which',4,'http://dbpedia.org/resource/Convolutional_code',1,NULL,NULL,'2014-11-04'),(69,'Lehmer Random Number Generator','The Lehmer random number generator[1] (named after D. H. Lehmer), sometimes also referred to as the Park–Miller random number generator (after Stephen K. Park and Keith W. Miller), is a variant of linear congruential generator (LCG) that operates in multiplicative group of integers modulo n. A general formula of a random number generator (RNG) of this type is:',18,'http://dbpedia.org/resource/Lehmer_random_number_generator',1,NULL,NULL,'2014-11-04'),(70,'Midpoint Circle Algorithm\n','In computer graphics, the midpoint circle algorithm is an algorithm used to determine the points needed for drawing a circle. The algorithm is a variant of Bresenham\'s line algorithm, and is thus sometimes known as Bresenham\'s circle algorithm, although not actually invented by Jack E. Bresenham. The algorithm can be generalized to conic sections.[1]',10,'http://dbpedia.org/resource/Midpoint_circle_algorithm',1,NULL,NULL,'2014-11-04'),(71,'Fixed Point Combinator\n','In computer science, a fixed-point combinator (or fixpoint combinator[1]) is a higher-order function that computes a fixed point of other functions. If the effect of the other function is to advance a particular computation one step, or to do nothing if the computation is finished, then the fixed point will be a function that advances the same computation by as many steps as required to complete it. This can be used for anonymous recursion: to construct recursive anonymous functions.',2,'http://dbpedia.org/resource/Fixed-point_combinator',1,NULL,NULL,'2014-11-04'),(72,'Methods Of Computing Square Ro','In numerical analysis, a branch of mathematics, there are several square root algorithms or methods for calculating the principal square root of a nonnegative real number. For the square roots of a negative or complex number, see below.',8,'http://dbpedia.org/resource/Methods_of_computing_square_roots',1,NULL,NULL,'2014-11-04'),(73,'Algorithms For Calculating Var','Algorithms for calculating variance play a major role in statistical computing. A key problem in the design of good algorithms for this problem is that formulas for the variance may involve sums of squares, which can lead to numerical instability as well as to arithmetic overflow when dealing with large values.',33,'http://dbpedia.org/resource/Algorithms_for_calculating_variance',1,NULL,NULL,'2014-11-04'),(74,'Interpolation Search\n','Interpolation search (sometimes referred to as extrapolation search) is an algorithm for searching for a given key value in an indexed array that has been ordered by the values of the key. It parallels how humans search through a telephone book for a particular name, the key value by which the book\'s entries are ordered. In each search step it calculates where in the remaining search space the sought item might be, based on the key values at the bounds of the search space and the value of the sought key, usually via a linear interpolation. The key value actually found at this estimated position is then compared to the key value being sought. If it is not equal, then depending on the comparison, the remaining search space is reduced to the part before or after the estimated position. This method will only work if calculations on the size of differences between key values are sensible.',38,'http://dbpedia.org/resource/Interpolation_search',1,NULL,NULL,'2014-11-04'),(75,'Escape Character\n','In computing and telecommunication, an escape character is a character which invokes an alternative interpretation on subsequent characters in a character sequence. An escape character is a particular case of metacharacters. Generally, the judgement of whether something is an escape character or not depends on context.',31,'http://dbpedia.org/resource/Escape_character',1,NULL,NULL,'2014-11-04'),(76,'Luhn Algorithm\n','The Luhn algorithm or Luhn formula, also known as the \"modulus 10\" or \"mod 10\" algorithm, is a simple checksum formula used to validate a variety of identification numbers, such as credit card numbers, IMEI numbers, National Provider Identifier numbers in US and Canadian Social Insurance Numbers. It was created by IBM scientist Hans Peter Luhn and described in U.S. Patent No. 2,950,048, filed on January 6, 1954, and granted on August 23, 1960.',42,'http://dbpedia.org/resource/Luhn_algorithm',1,NULL,NULL,'2014-11-04'),(77,'Multiplication Algorithm\n','A multiplication algorithm is an algorithm (or method) to multiply two numbers. Depending on the size of the numbers, different algorithms are in use. Efficient multiplication algorithms have existed since the advent of the decimal system.',40,'http://dbpedia.org/resource/Multiplication_algorithm',1,NULL,NULL,'2014-11-04'),(78,'Cksum\n','cksum is a command in Unix-like operating systems that generates a checksum value for a file or stream of data. The cksum command reads each file given in its arguments, or standard input if no arguments are provided, and outputs the file\'s CRC checksum and byte count.',42,'http://dbpedia.org/resource/Cksum',1,NULL,NULL,'2014-11-04'),(79,'Buzen\'s Algorithm\n','In queueing theory, a discipline within the mathematical theory of probability, Buzen\'s algorithm (or convolution algorithm) is an algorithm for calculating the normalization constant G(N) in the Gordon–Newell theorem. This method was first proposed by Jeffrey P. Buzen in 1973.[1] Computing G(N) is required to compute the stationary probability distribution of a closed queueing network.[2]',33,'http://dbpedia.org/resource/Buzen\'s_algorithm',1,NULL,NULL,'2014-11-04'),(80,'Minimax\n','Minimax (sometimes minmax) is a decision rule used in decision theory, game theory, statistics and philosophy for minimizing the possible loss for a worst case (maximum loss) scenario. Alternatively, it can be thought of as maximizing the minimum gain (maximin). Originally formulated for two-player zero-sum game theory, covering both the cases where players take alternate moves and those where they make simultaneous moves, it has also been extended to more complex games and to general decision making in the presence of uncertainty.',38,'http://dbpedia.org/resource/Minimax',1,NULL,NULL,'2014-11-04'),(81,'Binary Search Algorithm\n','In computer science, a binary search or half-interval search algorithm finds the position of a specified input value (the search \"key\") within an array sorted by key value.[1][2] In each step, the algorithm compares the search key value with the key value of the middle element of the array. If the keys match, then a matching element has been found and its index, or position, is returned. Otherwise, if the search key is less than the middle element\'s key, then the algorithm repeats its action on the sub-array to the left of the middle element or, if the search key is greater, on the sub-array to the right. If the remaining array to be searched is empty, then the key cannot be found in the array and a special \"not found\" indication is returned.',38,'http://dbpedia.org/resource/Binary_search_algorithm',1,0.532962962962963,NULL,'2014-11-04'),(82,'Computus\n','Computus (Latin for \"computation\") is the calculation of the date of Easter in terms of, first, the Julian and, later, the Gregorian calendar. The name has been used for this procedure since the early Middle Ages, as it was considered the most important computation of the age.',45,'http://dbpedia.org/resource/Computus',1,0.166666666666667,NULL,'2014-11-04'),(83,'Delimiter\n','A delimiter is a sequence of one or more characters used to specify the boundary between separate, independent regions in plain text or other data streams.[1] An example of a delimiter is the comma character, which acts as a field delimiter in a sequence of comma-separated values.',31,'http://dbpedia.org/resource/Delimiter',1,NULL,NULL,'2014-11-04'),(84,'International Standard Book Nu','The International Standard Book Number (ISBN) is a unique[1][2] numeric commercial book identifier based upon the 9-digit Standard Book Numbering (SBN) code created by Gordon Foster, Emeritus Professor of Statistics at Trinity College, Dublin,[3] for the booksellers and stationers W. H. Smith and others in 1965.[4]',42,'http://dbpedia.org/resource/International_Standard_Book_Number',1,NULL,NULL,'2014-11-04'),(85,'Pseudocode\n','Pseudocode is an informal high-level description of the operating principle of a computer program or other algorithm.',44,'http://dbpedia.org/resource/Pseudocode',1,0.616666666666667,NULL,'2014-11-04'),(86,'Regular Expression\n','In computing, a regular expression (abbreviated regex or regexp) is a sequence of text characters, some of which are understood to be metacharacters with symbolic meaning, and some of which have their literal meaning, that together can automatically identify textual material of a given pattern, or process a number of instances of it that can vary from a precise equality to a very general similarity of the pattern. The pattern sequence itself is an expression that is a statement in a language designed specifically to represent prescribed targets in the most concise and flexible way to direct the automation of text processing of general text files, specific textual forms, or of random input strings. A regular expression matches a pattern to a string. It is employed in a search to identify text for further processing, such as displaying the match, or altering it; or it is employed to simply inform of the location or count. The concept arose in the 1950s, when Kleene formalized the description of a regular language, and came into common use with the Unix text processing utilities ed, an editor, and grep (global regular expression print), a filter.',31,'http://dbpedia.org/resource/Regular_expression',1,NULL,NULL,'2014-11-04'),(87,'Rsync\n','rsync is a utility software and network protocol for Unix-like systems (with ports to Windows) that synchronizes files and directories from one location to another while minimizing data transfer by using delta encoding when appropriate. Quoting the official website: \"rsync is a file transfer program for Unix systems. rsync uses the \'rsync algorithm\' which provides a very fast method for bringing remote files into sync.\"[3] An important feature of rsync not found in most similar programs/protocols is that the mirroring takes place with only one transmission in each direction.[why?][4] rsync can copy or display directory contents and copy files, optionally using compression and recursion.',46,'http://dbpedia.org/resource/Rsync',1,NULL,NULL,'2014-11-04'),(88,'Double Dabble\n','In computer science, the double dabble algorithm is used to convert binary numbers into decimal (in particular, binary-coded decimal, or BCD, notation). The algorithm operates as follows:',40,'http://dbpedia.org/resource/Double_dabble',1,NULL,NULL,'2014-11-04'),(89,'Diff\n','In computing, diff is a file comparison utility that outputs the differences between two files. It is typically used to show the changes between one version of a file and a former version of the same file. Diff displays the changes made per line for text files. Modern implementations also support binary files.[1] The output is called a \"diff\", or a patch, since the output can be applied with the Unix program patch. The output of similar file comparison utilities are also called a \"diff\"; like the use of the word \"grep\" for describing the act of searching, the word diff is used in jargon as a verb for calculating any difference.[2]',31,'http://dbpedia.org/resource/Diff',1,NULL,NULL,'2014-11-04'),(90,'Index Mapping\n','Index mapping is a computer science term (also known as a \"trivial hash function\") that is used to describe the mapping[clarification needed] of raw data, used directly as in array index, for an array. The technique can be most effective for mapping data with a small range[clarification needed]. If the array encompasses all combinations of input, a range check is not required.',38,'http://dbpedia.org/resource/Index_mapping',1,NULL,NULL,'2014-11-04'),(91,'Double Hashing\n','Double hashing is a computer programming technique used in hash tables to resolve hash collisions, cases when two different values to be searched for produce the same hash key. It is a popular collision-resolution technique in open-addressed hash tables. Double hashing is implemented in many popular libraries.',38,'http://dbpedia.org/resource/Double_hashing',1,NULL,NULL,'2014-11-04'),(92,'Ida*\n','IDA*[1] is a variant of the A* search algorithm which uses iterative deepening to keep the memory usage lower than in A*. It is an informed search based on the idea of the uninformed iterative deepening depth-first search.',38,'http://dbpedia.org/resource/IDA*',1,NULL,NULL,'2014-11-04'),(93,'Ida*\n','IDA*[1] is a variant of the A* search algorithm which uses iterative deepening to keep the memory usage lower than in A*. It is an informed search based on the idea of the uninformed iterative deepening depth-first search.',34,'http://dbpedia.org/resource/IDA*',1,NULL,NULL,'2014-11-04'),(94,'Adler 32\n','Adler-32 is a checksum algorithm which was invented by Mark Adler in 1995,[1] and is a modification of the Fletcher checksum. Compared to a cyclic redundancy check of the same length, it trades reliability for speed (preferring the latter). Adler-32 is more reliable than Fletcher-16, and slightly less reliable than Fletcher-32.[2]',42,'http://dbpedia.org/resource/Adler-32',1,0.783333333333333,NULL,'2014-11-04'),(95,'A* Search Algorithm\n','In computer science, A* (pronounced \"A star\" ( listen)) is a computer algorithm that is widely used in pathfinding and graph traversal, the process of plotting an efficiently traversable path between points, called nodes. Noted for its performance and accuracy, it enjoys widespread use. (However, in practical travel-routing systems, it is generally outperformed by algorithms which can pre-process the graph to attain better performance.[1])',38,'http://dbpedia.org/resource/A*_search_algorithm',1,0.621897810218978,NULL,'2014-11-04'),(96,'A* Search Algorithm\n','In computer science, A* (pronounced \"A star\" ( listen)) is a computer algorithm that is widely used in pathfinding and graph traversal, the process of plotting an efficiently traversable path between points, called nodes. Noted for its performance and accuracy, it enjoys widespread use. (However, in practical travel-routing systems, it is generally outperformed by algorithms which can pre-process the graph to attain better performance.[1])',34,'http://dbpedia.org/resource/A*_search_algorithm',1,0.916666666666667,NULL,'2014-11-04'),(97,'Mtd F\n','MTD(f), is a minimax search algorithm, developed in 1994 by Aske Plaat, Jonathan Schaeffer, Wim Pijls, and Arie de Bruin. Experiments with tournament quality chess, checkers, and Othello programs show it to be the most efficient minimax algorithm. The name MTD(f) is an abbreviation for MTD(n,f) (Memory-enhanced Test Driver with node n and value f). It is an alternative to the alpha-beta pruning algorithm.',38,'http://dbpedia.org/resource/MTD-f',1,NULL,NULL,'2014-11-04'),(98,'Ternary Search\n','A ternary search algorithm is a technique in computer science for finding the minimum or maximum of an increasing or decreasing function. A ternary search determines either that the minimum or maximum cannot be in the first third of the domain or that it cannot be in the last third of the domain, then repeats on the remaining two-thirds. A ternary search is an example of a divide and conquer algorithm (see search algorithm).',38,'http://dbpedia.org/resource/Ternary_search',1,NULL,NULL,'2014-11-04'),(99,'Wang And Landau Algorithm\n','The Wang and Landau algorithm, proposed by Fugao Wang and David P. Landau,[1] is a Monte Carlo method designed to calculate the density of states of a system. The method performs a non-markovian random walk to build the density of states by quickly visiting all the available energy spectrum. The Wang and Landau algorithm is an important method to obtain the density of states required to perform a multicanonical simulation.',33,'http://dbpedia.org/resource/Wang_and_Landau_algorithm',1,0.7,NULL,'2014-11-04'),(100,'Wang And Landau Algorithm\n','The Wang and Landau algorithm, proposed by Fugao Wang and David P. Landau,[1] is a Monte Carlo method designed to calculate the density of states of a system. The method performs a non-markovian random walk to build the density of states by quickly visiting all the available energy spectrum. The Wang and Landau algorithm is an important method to obtain the density of states required to perform a multicanonical simulation.',35,'http://dbpedia.org/resource/Wang_and_Landau_algorithm',1,NULL,NULL,'2014-11-04'),(101,'Java Hashcode()\n','In the Java programming language, every class must provide a hashCode() method which digests the data stored in an instance of the class into a single hash value (a 32-bit signed integer). This hash is used by other code when storing or manipulating the instance - the values are intended to be evenly distributed for varied inputs in order to use in clustering. This property is important to the performance of hash tables and other data structures that store objects in groups (\"buckets\") based on their computed hash values.',42,'http://dbpedia.org/resource/Java_hashCode()',1,NULL,NULL,'2014-11-04'),(102,'Md5\n','A 2009 attack by Tao Xie and Dengguo Feng breaks MD5 collision resistance in 220.96 time. This attack runs in a few seconds on a regular computer.[2]',42,'http://dbpedia.org/resource/MD5',1,1,NULL,'2014-11-04'),(103,'Perceptron\n','In computational geometry, the perceptron is an algorithm for supervised classification of an input into one of several possible non-binary outputs. It is a type of linear classifier, i.e. a classification algorithm that makes its predictions based on a linear predictor function combining a set of weights with the feature vector describing a given input using the delta rule. The learning algorithm for perceptrons is an online algorithm, in that it processes elements in the training set one at a time.',37,'http://dbpedia.org/resource/Perceptron',1,NULL,NULL,'2014-11-04'),(104,'Sma*\n','SMA* or Simplified Memory Bounded A* is a shortest path algorithm based on the A* algorithm. The main advantage of SMA* is that it uses a bounded memory, while the A* algorithm might need exponential memory. All other characteristics of SMA* are inherited from A*.',38,'http://dbpedia.org/resource/SMA*',1,NULL,NULL,'2014-11-04'),(105,'Sma*\n','SMA* or Simplified Memory Bounded A* is a shortest path algorithm based on the A* algorithm. The main advantage of SMA* is that it uses a bounded memory, while the A* algorithm might need exponential memory. All other characteristics of SMA* are inherited from A*.',34,'http://dbpedia.org/resource/SMA*',1,NULL,NULL,'2014-11-04'),(106,'Fletcher\'s Checksum\n','The Fletcher checksum is an algorithm for computing a position-dependent checksum devised by John G. Fletcher at Lawrence Livermore Labs in the late 1970s.[1] The objective of the Fletcher checksum was to provide error-detection properties approaching those of a cyclic redundancy check but with the lower computational effort associated with summation techniques.',42,'http://dbpedia.org/resource/Fletcher\'s_checksum',1,NULL,NULL,'2014-11-04'),(107,'Luhn Mod N Algorithm\n','The Luhn mod N algorithm is an extension to the Luhn algorithm (also known as mod 10 algorithm) that allows it to work with sequences of non-numeric characters. This can be useful when a check digit is required to validate an identification string composed of letters, a combination of letters and digits or even any arbitrary set of characters.',42,'http://dbpedia.org/resource/Luhn_mod_N_algorithm',1,NULL,NULL,'2014-11-04'),(108,'Find (command)\n','In computing, find is a command in the command line interpreters (shells) of DOS, OS/2 and Microsoft Windows. It is used to search for a specific text string in a file or files. The command sends the specified lines to the standard output device.',31,'http://dbpedia.org/resource/Find_(command)',1,0.375,NULL,'2014-11-04'),(109,'Exponentiation By Squaring\n','In mathematics and computer programming, exponentiating by squaring is a general method for fast computation of large positive integer powers of a number, or, more generally of an element of a ring, like a polynomial of a square matrix. Some variants are commonly referred to as square-and-multiply algorithms or binary exponentiation. In additive notation the appropriate term is double-and-add. These can be of quite general use: for example in modular arithmetic or powering of matrices.',40,'http://dbpedia.org/resource/Exponentiation_by_squaring',1,NULL,NULL,'2014-11-04'),(110,'Pattern Matching\n','In computer science, pattern matching is the act of checking a perceived sequence of tokens for the presence of the constituents of some pattern. In contrast to pattern recognition, the match usually has to be exact. The patterns generally have the form of either sequences or tree structures. Uses of pattern matching include outputting the locations (if any) of a pattern within a token sequence, to output some component of the matched pattern, and to substitute the matching pattern with some other token sequence (i.e., search and replace).',31,'http://dbpedia.org/resource/Pattern_matching',1,NULL,NULL,'2014-11-04'),(111,'Extendible Hashing\n','Extendible hashing is a type of hash system which treats a hash as a bit string, and uses a trie for bucket lookup.[1] Because of the hierarchical nature of the system, re-hashing is an incremental operation (done one bucket at a time, as needed). This means that time-sensitive applications are less affected by table growth than by standard full-table rehashes.',38,'http://dbpedia.org/resource/Extendible_hashing',1,NULL,NULL,'2014-11-04'),(112,'Grover\'s algorithm','<p style=\"margin: 0.5em 0px; line-height: 22.399999618530273px; color: #252525; font-family: sans-serif; font-size: 14px;\"><strong>Grover\'s algorithm</strong>&nbsp;is a&nbsp;<a style=\"text-decoration: none; color: #0b0080; background: none;\" title=\"Quantum algorithm\" href=\"http://en.wikipedia.org/wiki/Quantum_algorithm\">quantum algorithm</a>&nbsp;for searching an&nbsp;<a style=\"text-decoration: none; color: #0b0080; background: none;\" title=\"Sorting\" href=\"http://en.wikipedia.org/wiki/Sorting\">unsorted</a>&nbsp;<a style=\"text-decoration: none; color: #0b0080; background: none;\" title=\"Database\" href=\"http://en.wikipedia.org/wiki/Database\">database</a>&nbsp;with&nbsp;<em>N</em>&nbsp;entries in&nbsp;<em>O</em>(<em>N</em><sup style=\"line-height: 1;\">1/2</sup>) time and using&nbsp;<em>O</em>(log&nbsp;<em>N</em>) storage space (see&nbsp;<a style=\"text-decoration: none; color: #0b0080; background: none;\" title=\"Big O notation\" href=\"http://en.wikipedia.org/wiki/Big_O_notation\">big O notation</a>).&nbsp;<a class=\"mw-redirect\" style=\"text-decoration: none; color: #0b0080; background: none;\" title=\"Lov K. Grover\" href=\"http://en.wikipedia.org/wiki/Lov_K._Grover\">Lov Grover</a>formulated it in 1996.</p>\r\n<p style=\"margin: 0.5em 0px; line-height: 22.399999618530273px; color: #252525; font-family: sans-serif; font-size: 14px;\">In models of classical computation, searching an unsorted database cannot be done in less than&nbsp;<a class=\"mw-redirect\" style=\"text-decoration: none; color: #0b0080; background: none;\" title=\"Linear time\" href=\"http://en.wikipedia.org/wiki/Linear_time\">linear time</a>&nbsp;(so merely&nbsp;<a style=\"text-decoration: none; color: #0b0080; background: none;\" title=\"Linear search\" href=\"http://en.wikipedia.org/wiki/Linear_search\">searching through every item</a>&nbsp;is optimal). Grover\'s algorithm illustrates that in the quantum model searching can be done faster than this; in fact its time complexity&nbsp;<em>O</em>(<em>N</em><sup style=\"line-height: 1;\">1/2</sup>) is asymptotically the fastest possible for searching an unsorted database in the&nbsp;<em>linear</em>&nbsp;quantum model.<sup id=\"cite_ref-bennett_1997_1-0\" class=\"reference\" style=\"line-height: 1; unicode-bidi: -webkit-isolate;\"><a style=\"text-decoration: none; color: #0b0080; white-space: nowrap; background: none;\" href=\"http://en.wikipedia.org/wiki/Grover\'s_algorithm#cite_note-bennett_1997-1\">[1]</a></sup>&nbsp;It provides a quadratic speedup, unlike other quantum algorithms, which may provide exponential speedup over their classical counterparts. However, even quadratic speedup is considerable when&nbsp;<em>N</em>&nbsp;is large. Unsorted search speeds of up to&nbsp;<a class=\"mw-redirect\" style=\"text-decoration: none; color: #0b0080; background: none;\" title=\"Constant time\" href=\"http://en.wikipedia.org/wiki/Constant_time\">constant time</a>&nbsp;are achievable in the&nbsp;<em>nonlinear</em>&nbsp;quantum model.<sup id=\"cite_ref-2\" class=\"reference\" style=\"line-height: 1; unicode-bidi: -webkit-isolate;\"><a style=\"text-decoration: none; color: #0b0080; white-space: nowrap; background: none;\" href=\"http://en.wikipedia.org/wiki/Grover\'s_algorithm#cite_note-2\">[2]</a></sup></p>\r\n<p style=\"margin: 0.5em 0px; line-height: 22.399999618530273px; color: #252525; font-family: sans-serif; font-size: 14px;\">Like many quantum algorithms, Grover\'s algorithm is probabilistic in the sense that it gives the correct answer with high&nbsp;<a style=\"text-decoration: none; color: #0b0080; background: none;\" title=\"Probability\" href=\"http://en.wikipedia.org/wiki/Probability\">probability</a>. The probability of failure can be decreased by repeating the algorithm. (An example of a deterministic quantum algorithm is the&nbsp;<a class=\"mw-redirect\" style=\"text-decoration: none; color: #0b0080; background: none;\" title=\"Deutsch-Jozsa algorithm\" href=\"http://en.wikipedia.org/wiki/Deutsch-Jozsa_algorithm\">Deutsch-Jozsa algorithm</a>, which always produces the correct answer.)</p>',32,'',0,0,2,'2014-11-04'),(113,'Kmeans Clustering','<p style=\"margin: 0.5em 0px; line-height: 22.399999618530273px; color: #252525; font-family: sans-serif; font-size: 14px;\"><strong><em>k</em>-means clustering</strong>&nbsp;is a method of&nbsp;<a style=\"text-decoration: none; color: #0b0080; background: none;\" title=\"Vector quantization\" href=\"http://en.wikipedia.org/wiki/Vector_quantization\">vector quantization</a>, originally from signal processing, that is popular for&nbsp;<a style=\"text-decoration: none; color: #0b0080; background: none;\" title=\"Cluster analysis\" href=\"http://en.wikipedia.org/wiki/Cluster_analysis\">cluster analysis</a>&nbsp;in&nbsp;<a style=\"text-decoration: none; color: #0b0080; background: none;\" title=\"Data mining\" href=\"http://en.wikipedia.org/wiki/Data_mining\">data mining</a>.&nbsp;<em>k</em>-means clustering aims to&nbsp;<a style=\"text-decoration: none; color: #0b0080; background: none;\" title=\"Partition of a set\" href=\"http://en.wikipedia.org/wiki/Partition_of_a_set\">partition</a>&nbsp;<em>n</em>&nbsp;observations into&nbsp;<em>k</em>&nbsp;clusters in which each observation belongs to the cluster with the nearest&nbsp;<a style=\"text-decoration: none; color: #0b0080; background: none;\" title=\"Mean\" href=\"http://en.wikipedia.org/wiki/Mean\">mean</a>, serving as a&nbsp;<a style=\"text-decoration: none; color: #0b0080; background: none;\" title=\"Prototype\" href=\"http://en.wikipedia.org/wiki/Prototype\">prototype</a>&nbsp;of the cluster. This results in a partitioning of the data space into&nbsp;<a class=\"mw-redirect\" style=\"text-decoration: none; color: #0b0080; background: none;\" title=\"Voronoi cell\" href=\"http://en.wikipedia.org/wiki/Voronoi_cell\">Voronoi cells</a>.</p>\r\n<p style=\"margin: 0.5em 0px; line-height: 22.399999618530273px; color: #252525; font-family: sans-serif; font-size: 14px;\">The problem is computationally difficult (<a style=\"text-decoration: none; color: #0b0080; background: none;\" title=\"NP-hard\" href=\"http://en.wikipedia.org/wiki/NP-hard\">NP-hard</a>); however, there are efficient&nbsp;<a class=\"mw-redirect\" style=\"text-decoration: none; color: #0b0080; background: none;\" title=\"Heuristic algorithm\" href=\"http://en.wikipedia.org/wiki/Heuristic_algorithm\">heuristic algorithms</a>&nbsp;that are commonly employed and converge quickly to a local optimum. These are usually similar to the&nbsp;<a class=\"mw-redirect\" style=\"text-decoration: none; color: #0b0080; background: none;\" title=\"Expectation-maximization algorithm\" href=\"http://en.wikipedia.org/wiki/Expectation-maximization_algorithm\">expectation-maximization algorithm</a>&nbsp;for&nbsp;<a style=\"text-decoration: none; color: #0b0080; background: none;\" title=\"Mixture model\" href=\"http://en.wikipedia.org/wiki/Mixture_model\">mixtures</a>&nbsp;of&nbsp;<a class=\"mw-redirect\" style=\"text-decoration: none; color: #0b0080; background: none;\" title=\"Gaussian distribution\" href=\"http://en.wikipedia.org/wiki/Gaussian_distribution\">Gaussian distributions</a>&nbsp;via an iterative refinement approach employed by both algorithms. Additionally, they both use cluster centers to model the data; however,&nbsp;<em>k</em>-means clustering tends to find clusters of comparable spatial extent, while the expectation-maximization mechanism allows clusters to have different shapes.</p>',9,'',0,0,2,'2014-11-04'),(114,'Bubble Sort','<p>template &lt;class t&gt;</p>\r\n<p>void bubbleSort(vector&lt;t&gt; &amp;vetor){</p>\r\n<p>for(int i = (int)vetor.size()-1; i &gt;= 1; --i) { &nbsp;</p>\r\n<p>for(int j = 0; j &lt; i ; j++) {</p>\r\n<p>if(vetor[j] &gt; vetor[j+1]) {</p>\r\n<p>swap(vetor[j], vetor[j+1]);</p>\r\n<p>}</p>\r\n<p>}</p>\r\n<p>}</p>\r\n<p>}</p>\r\n<p>&nbsp;</p>',7,'',0,0,62,'2014-11-04'),(115,'teste','<p>Hello</p>',44,'',0,0,99,'2015-05-11'),(116,'Knuth–Morris–Pratt algorithm','<p>The KMP algorithm searches for occurrences of a string W in a string S of equal or greater length. This is done by observing that the string W itself embodies enough information to recover from mismatches without having to go back on the string S.</p>\r\n<p>The algorithm is divided in two portions, both with linear time complexity.</p>\r\n<p>The first portion preprocesses the string W to generate a lookup table used by the second portion. This table contains information that enables the search to recover from mismatches.</p>\r\n<p>The second portion of the algorithm is the search itself.</p>',31,'',0,0,100,'2015-05-11'),(117,'Logarithm, Base 10','<p>mLite algorithm for finding the Log10 of a floating point number to many decimal places.</p>',41,'',0,0,107,'2015-09-25');
