,NULL,0),(133,50,'<pre class=\"de1\">\n<span class=\"kw1\">function</span> xmin=purecmaes   <span class=\"co1\">% (mu/mu_w, lambda)-CMA-ES </span>\n \n  <span class=\"co1\">% --------------------  Initialization --------------------------------  </span>\n  <span class=\"co1\">% User defined input parameters (need to be edited)</span>\n  strfitnessfct = <span class=\"co2\">\'frosenbrock\'</span>;  <span class=\"co1\">% name of objective/fitness function</span>\n  N = <span class=\"nu0\">20</span>;               <span class=\"co1\">% number of objective variables/problem dimension</span>\n  xmean = <span class=\"kw2\">rand</span><span class=\"br0\">(</span>N,<span class=\"nu0\">1</span><span class=\"br0\">)</span>;    <span class=\"co1\">% objective variables initial point</span>\n  sigma = <span class=\"nu0\">0.3</span>;          <span class=\"co1\">% coordinate wise standard deviation (step size)</span>\n  stopfitness = 1e-10;  <span class=\"co1\">% stop if fitness &lt; stopfitness (minimization)</span>\n  stopeval = 1e3*N^<span class=\"nu0\">2</span>;   <span class=\"co1\">% stop after stopeval number of function evaluations</span>\n \n  <span class=\"co1\">% Strategy parameter setting: Selection  </span>\n  lambda = <span class=\"nu0\">4</span>+<span class=\"kw2\">floor</span><span class=\"br0\">(</span><span class=\"nu0\">3</span>*<span class=\"kw2\">log</span><span class=\"br0\">(</span>N<span class=\"br0\">)</span><span class=\"br0\">)</span>;  <span class=\"co1\">% population size, offspring number</span>\n  mu = lambda/<span class=\"nu0\">2</span>;               <span class=\"co1\">% number of parents/points for recombination</span>\n  weights = <span class=\"kw2\">log</span><span class=\"br0\">(</span>mu+<span class=\"nu0\">1</span>/<span class=\"nu0\">2</span><span class=\"br0\">)</span>-<span class=\"kw2\">log</span><span class=\"br0\">(</span><span class=\"nu0\">1</span>:mu<span class=\"br0\">)</span>\'; <span class=\"co1\">% muXone array for weighted recombination</span>\n  mu = <span class=\"kw2\">floor</span><span class=\"br0\">(</span>mu<span class=\"br0\">)</span>;        \n  weights = weights/<span class=\"kw2\">sum</span><span class=\"br0\">(</span>weights<span class=\"br0\">)</span>;     <span class=\"co1\">% normalize recombination weights array</span>\n  mueff=<span class=\"kw2\">sum</span><span class=\"br0\">(</span>weights<span class=\"br0\">)</span>^<span class=\"nu0\">2</span>/<span class=\"kw2\">sum</span><span class=\"br0\">(</span>weights.^<span class=\"nu0\">2</span><span class=\"br0\">)</span>; <span class=\"co1\">% variance-effectiveness of sum w_i x_i</span>\n \n  <span class=\"co1\">% Strategy parameter setting: Adaptation</span>\n  cc = <span class=\"br0\">(</span><span class=\"nu0\">4</span>+mueff/N<span class=\"br0\">)</span> / <span class=\"br0\">(</span>N+<span class=\"nu0\">4</span> + <span class=\"nu0\">2</span>*mueff/N<span class=\"br0\">)</span>;  <span class=\"co1\">% time constant for cumulation for C</span>\n  cs = <span class=\"br0\">(</span>mueff+<span class=\"nu0\">2</span><span class=\"br0\">)</span> / <span class=\"br0\">(</span>N+mueff+<span class=\"nu0\">5</span><span class=\"br0\">)</span>;  <span class=\"co1\">% t-const for cumulation for sigma control</span>\n  c1 = <span class=\"nu0\">2</span> / <span class=\"br0\">(</span><span class=\"br0\">(</span>N+<span class=\"nu0\">1.3</span><span class=\"br0\">)</span>^<span class=\"nu0\">2</span>+mueff<span class=\"br0\">)</span>;    <span class=\"co1\">% learning rate for rank-one update of C</span>\n  cmu = <span class=\"kw2\">min</span><span class=\"br0\">(</span><span class=\"nu0\">1</span>-c1, <span class=\"nu0\">2</span> * <span class=\"br0\">(</span>mueff-<span class=\"nu0\">2</span>+<span class=\"nu0\">1</span>/mueff<span class=\"br0\">)</span> / <span class=\"br0\">(</span><span class=\"br0\">(</span>N+<span class=\"nu0\">2</span><span class=\"br0\">)</span>^<span class=\"nu0\">2</span>+mueff<span class=\"br0\">)</span><