br0\">)</span>; <span class=\"co1\">% minimization</span>\n      xold = xmean;\n      xmean = arx<span class=\"br0\">(</span>:,arindex<span class=\"br0\">(</span><span class=\"nu0\">1</span>:mu<span class=\"br0\">)</span><span class=\"br0\">)</span>*weights;   <span class=\"co1\">% recombination, new mean value</span>\n \n      <span class=\"co1\">% Cumulation: Update evolution paths</span>\n      ps = <span class=\"br0\">(</span><span class=\"nu0\">1</span>-cs<span class=\"br0\">)</span>*ps <span class=\"sy0\">...</span> \n            + <span class=\"kw2\">sqrt</span><span class=\"br0\">(</span>cs*<span class=\"br0\">(</span><span class=\"nu0\">2</span>-cs<span class=\"br0\">)</span>*mueff<span class=\"br0\">)</span> * invsqrtC * <span class=\"br0\">(</span>xmean-xold<span class=\"br0\">)</span> / sigma; \n      hsig = <span class=\"kw2\">norm</span><span class=\"br0\">(</span>ps<span class=\"br0\">)</span>/<span class=\"kw2\">sqrt</span><span class=\"br0\">(</span><span class=\"nu0\">1</span>-<span class=\"br0\">(</span><span class=\"nu0\">1</span>-cs<span class=\"br0\">)</span>^<span class=\"br0\">(</span><span class=\"nu0\">2</span>*counteval/lambda<span class=\"br0\">)</span><span class=\"br0\">)</span>/chiN &lt; <span class=\"nu0\">1.4</span> + <span class=\"nu0\">2</span>/<span class=\"br0\">(</span>N+<span class=\"nu0\">1</span><span class=\"br0\">)</span>;\n      pc = <span class=\"br0\">(</span><span class=\"nu0\">1</span>-cc<span class=\"br0\">)</span>*pc <span class=\"sy0\">...</span>\n            + hsig * <span class=\"kw2\">sqrt</span><span class=\"br0\">(</span>cc*<span class=\"br0\">(</span><span class=\"nu0\">2</span>-cc<span class=\"br0\">)</span>*mueff<span class=\"br0\">)</span> * <span class=\"br0\">(</span>xmean-xold<span class=\"br0\">)</span> / sigma; \n \n      <span class=\"co1\">% Adapt covariance matrix C</span>\n      artmp = <span class=\"br0\">(</span><span class=\"nu0\">1</span>/sigma<span class=\"br0\">)</span> * <span class=\"br0\">