p>&nbsp; &nbsp; &nbsp; &nbsp;| (n, x) = ntol (n div 10, (n mod 10) :: x)</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;| n &nbsp; &nbsp; &nbsp;= ntol (n, [])</p>\r\n<p>and &nbsp;</p>\r\n<p>powers_of_10 9 = 1000000000</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;| 8 = 100000000</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;| 7 = 10000000</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;| 6 = 1000000</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;| 5 = 100000</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;| 4 = 10000</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;| 3 = 1000</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;| 2 = 100</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;| 1 = 10</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;| 0 = 1</p>\r\n<p>and&nbsp;</p>\r\n<p>size (c, 0) = c</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;| (c, n &gt; 9999999999) = size (c + 10, trunc (n / 10000000000))</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;| (c, n) &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;= size (c + &nbsp;1, trunc (n / 10))</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;| n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; = size ( &nbsp; &nbsp; 0, trunc (n / 10))</p>\r\n<p>and&nbsp;</p>\r\n<p>makeVisible L = map (fn x = if int x then chr (x + 48) else x) L</p>\r\n<p>and&nbsp;</p>\r\n<p>log10 (n, 0, x) = ston ` implode ` makeVisible ` rev x</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; | (n, c, x) =</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; let val n\' = n^10;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; val size_n\' = size n\'</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; in&nbsp;</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; log10 (n\' / powers_of_10 size_n\', c - 1, size_n\' :: x)</p>\r\n<p>end</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; | (n, c) =</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; let</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; val size_n = size n</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; in</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; log10 (n / 10^size_n, c, #\".\" :: rev (ntol size_n) @ [])</p>\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; end</p>\r\n<p>;</p>\r\n<p>&nbsp;</p>',5,0,0,107,0);
